import React from 'react';

function Button(props) {
  var textAlign = props.textAlign === 'submit' ? 'transparent' : props.backgroundColor;

  return (
    <button
      style={{
        backgroundColor: props.type === 'submit' ? 'transparent' : props.backgroundColor,
        color: 'white',
        fontSize: '16px',
        padding: '15px 32px',
        margin: '4px 2px',
        cursor: 'pointer',
        textAlign: props.type === 'submit' ? 'transparent' : props.backgroundColor,
        textDecoration: 'none',
        border: 'black solid 2px',
        borderRadius:'10px'
      }}
    >
      {props.text}
    </button>
  );
}

export default Button;
